import React from "react";
import "./Education.css";

const Education = () => {
  return (
    <div className="eduContainer">
      <p>I'm</p>
      <div className="degree">
        <p>
          pursuing <span></span> B.Tech in the department of Computer Science and Engineering
          at Sri Vasavi Engineering College, Tadepalligudem
        </p>
      </div>
      <div className="inter">
        <p>
          Completed +2 qualification in the stream of MPC from Sri Chaitanya
          Boys Jr. College, Vijayawada
        </p>
      </div>
      <div className="ssc">
        <p>Secondary Schooling at MSRZP High school, Ananthapalli</p>
      </div>
    </div>
  );
};

export default Education;
